"     </b>",
"     (Cyclobenzaprine HCl Transdermal)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     20 mg/g (60 g): $227.20",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Kit",
"     </b>",
"     (Cyclobenzaprine Comfort Pac Combination)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     10 mg (1): $74.75",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablets",
"     </b>",
"     (Cyclobenzaprine HCl Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     5 mg (100): $164.05",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     7.5 mg (1000): $3873.82",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     10 mg (100): $115.75",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablets",
"     </b>",
"     (Flexeril Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     5 mg (100): $189.13",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     10 mg (100): $209.86",
"    </p>",
"   </div>",
"   <div class=\"list fbnlist drugH1Div drugBrandNames\" id=\"F155263\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     International Brand Names",
"    </span>",
"    <ul>",
"     <li>",
"      Binelax ER (KP);",
"     </li>",
"     <li>",
"      Ciclamil (CN);",
"     </li>",
"     <li>",
"      Cycloflex (IL);",
"     </li>",
"     <li>",
"      Flexer (PE, TW);",
"     </li>",
"     <li>",
"      Flexiban (AR, IT, PT);",
"     </li>",
"     <li>",
"      Miosan (BR);",
"     </li>",
"     <li>",
"      Musgud (TW);",
"     </li>",
"     <li>",
"      Tensodox (EC, PE);",
"     </li>",
"     <li>",
"      Yuredol (MX);",
"     </li>",
"     <li>",
"      Yurelax (ES)",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F155244\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Centrally-acting skeletal muscle relaxant pharmacologically related to tricyclic antidepressants; reduces tonic somatic motor activity influencing both alpha and gamma motor neurons",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F155259\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Hepatic via CYP3A4, 1A2, and 2D6; may undergo enterohepatic recirculation",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: 33% to 55%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Range: 8-37 hours; Immediate release tablet: 18 hours; Extended release capsule: 32-33 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: Extended release capsule: 7-8 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (as inactive metabolites); feces (as unchanged drug)",
"    </p>",
"   </div>",
"  </div>",
