" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 498px\">",
"   <div class=\"ttl\">",
"    Complete RBBB",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 478px; height: 293px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electrocardiogram showing characteristic changes in the precordial leads in complete RBBB. The asynchronous activation of the two ventricles increases the QRS duration (0.13 sec). The terminal forces are rightward and anterior due the delayed activation of the right ventricle, resulting in an rsR' pattern in the anterior-posterior lead V1 and a wide negative S wave in the left-right lead V6 (and, not shown, in lead I).",
"    <div class=\"footnotes\">",
"    </div>",
